import React from 'react'; 
import Tilt from 'react-tilt';
import camera from './camera.png';
import './Logo.css';


const Logo = () =>{
	return(
		<div className="ma4 mt0">
			<Tilt className="Tilt br4 shadow-2" options={{ max : 25 }} style={{ height: 250, width: 250 }} >
	 			<div className="Tilt-inner">
	 				<img src={camera}/>
	 			</div>
			</Tilt>

		</div>



	);
}




export default Logo;
